    "headlineNews": "Derek Carr completed 21-of-34 passes for 196 yards, two touchdowns, and one interception in the Raiders' 28-14, Week 4 loss to the Chargers Monday night.\n",
    "report": "",
    "analysis": "Carr was in the MVP conversation headed into this one, but this game pretty much put an end to that talk. He was 7-of-13 for 52 scoreless yards at halftime with the Raiders trailing 21-0. Carr tried to guide the Raiders back with third-quarter touchdowns to Hunter Renfrow and Darren Waller, but a costly fourth-quarter interception put an end to Vegas' hopes. The throw went to a completely covered Waller and was picked off by Derwin James. Carr has two touchdowns in every game to this point and gets another tougher draw in Week 5 against the Bears on a short week. Carr will be more of a middling QB2 in that one for fantasy.\n",
