    "headlineNews": "Joe Burrow completed 25-of-32 passes for 348 yards and two touchdowns in the Bengals' 24-21, Week 4 win over the Jaguars.\u00a0\n",
    "report": "",
    "analysis": "The Bengals took their first lead as time expired in the fourth quarter, with Evan McPherson kicking the game-winning field goal after Burrow found TE C.J. Uzomah for yet another big play. With Tee Higgins (shoulder) on the shelf for his second and apparently final game, Burrow predictably peppered Tyler Boyd and Ja'Marr Chase with targets. Boyd did work after the catch with Chase making tough grabs in traffic. Uzomah was the X factor, however, getting free over the middle of the field and rolling toward the end zone like a bowling ball en route to 5/95/2. Burrow set season highs across the board this evening, with the 300-yard effort being his first of 2021. He averaged an eye-popping 10.9 yards on his 32 attempts, thanks in part to his pass catchers' YAC work. Burrow has been passing the eye test even as the Bengals work to limit his volume coming off his ACL tear. He's going to have to air it out in next week's home showdown with the Packers.\u00a0\n",
