    "headlineNews": "Jacoby Brissett completed 20of-30 passes for 199 yards and two touchdowns in the Dolphins' 27-17, Week 4 loss to the Colts.\n",
    "report": "",
    "analysis": "Both of Brissett's touchdowns came in the fourth quarter after the Colts had already taken a three-score lead. The veteran passer finally began to take downfield shots but it was too little too late as the game had been out of reach for some time by that point. Brissett added a trio of carries for eight yards on the ground. Through a little less than three games of action, Brissett is averaging just 4.9 yards per pass attempt and is getting sacked three times per game. He gets a potentially exciting matchup with the Bucs next week but it's impossible to find a sense of optimism after watching his poor play in relief of Tua Tagoaviloa. He's a weak option at quarterback even in Superflex leagues.\n",
