    "headlineNews": "Austin Ekeler rushed 15 times for 117 yards and one touchdown in the Chargers' Week 4 win over the Raiders, adding three catches for 28 yards and one touchdown on five targets.\n",
    "report": "",
    "analysis": "Ekeler sent fantasy players into a panic when he left the field early in the first quarter with a noticeable limp that sent him to the blue medical tent, but he quickly returned and posted his first 100-yard rushing game of the year, matching a season-high with 15 carries. Ekeler's first touchdown was a 14-yard catch where he straight whooped LB K.J. Wright in coverage, and his second was an 11-yard run in the fourth quarter to put L.A. ahead 28-14. Ekeler has four touchdowns in four games to start the year and is an every-week RB1 ahead of a Week 5 date with the Browns.\n",
