    "headlineNews": "Najee Harris rushed 15 times for 62 yards and one touchdown in the Steelers' Week 4 loss to the Packers, adding six catches for 29 yards on seven targets.\n",
    "report": "",
    "analysis": "It was another high-volume day for the Steelers' first-round rookie back, 21-of-22 backfield touches, ceding just one carry to Benny Snell. The rushing numbers haven't been there for Harris behind this atrocious offensive line in a broken scheme with a statuesque quarterback in Big Ben, but volume has proven king for Harris, who now has 81 touches through four games. He's averaging 13.75 carries per game for 46.25 yards on the ground each week, but Harris did punch in his first rushing touchdown with a one-yarder in the fourth quarter in this one. Harris has a whopping 26 catches through four weeks. Harris will be a volume-based RB1 next week against the Broncos.\n",
