    "headlineNews": "Chuba Hubbard rushed 13 times for 57 yards, hauling in both of his targets for 14 yards in Carolina's Week 4 loss to Dallas.\n",
    "report": "",
    "analysis": "Hubbard's workhorse usage on early downs, out-carrying Royce Freeman 13-3, was expected. Rodney Smith's usage in the receiving game came out of left field, though, out-targeting Hubbard 5-2 in what was essentially a blowout game script for the entire fourth quarter; having registered four of his five targets while the Panthers were trailing by two scores, it's possible Smith was only in the game for that reason. It didn't help that Hubbard was also vultured by his own quarterback inside the red zone, seeing Sam Darnold plow ahead for 11- and one-yard rushing scores. Hubbard will still rank as a touch-based RB2 against Philadelphia in Week 5 given the injury-riddled landscape of his position.\n",
