    "analysis": "Rookie Kenneth Gainwell has been the team's most effective backfield option through the season's first month, outplaying Sanders in Week 4 with 31 rushing yards, six receptions for 58 yards, and a touchdown. Gainwell, who headed into Week 4 splitting pass-catching duties with Sanders, seemed to take over as Nick Sirriani's preferred running back in two-minute drills and third downs. Sanders has seen more than 60 percent of the Eagles' offensive snaps in each of their first four games, positioning him as the lead back for now. Both Philly RBs will be tough to trust in Week 5 against Carolina.\u00a0\n",
