    "analysis": "Moore's two touchdowns while CB Trevon Diggs (back) was sidelined in garbage time against Dallas shouldn't overshadow the former's 12 targets in back-to-back games, leading the team with a 30.7% target share from Sam Darnold. He was also stopped at the one-yard line on a target inside the 10 during Carolina's second possession, setting up the first of Sam Darnold's two rushing scores on the day. With double-digit targets in three consecutive games, Moore's volume is in no danger of disappearing any time soon \u2014 especially with Christian McCaffrey (hamstring) sidelined for the next 2-3 games. Moore will again rank as a low-end WR1 in Week 5 against the Eagles.\n",
